import React from 'react';
import {withRouter} from 'react-router-dom';
import classes from '../contact-item-component/contact-item.module.css';
import { Context } from '../../App';

const contact_item = (props) => {
    console.log(props);
    return(
       <Context.Consumer>
           {
               (obj) => {
                   return(
                    <div onClick={() => {props.history.push(`/contacts/${obj.contact.id}`)}}>
                        <h2>{props.name}</h2>
                        <h3>{props.contact.phone}</h3>
                    </div>
                   );
               }
           }
       </Context.Consumer>
    );
}

export default withRouter(contact_item);
